/** @jsx jsx */
import { jsx, css } from '@emotion/core';
import React from 'react';

import Layout from '../components/Layout';
const styles = css`
  h2 {
    font-size: 20px;
    text-align: center;
  }
  text-align: center;
  p {
    margin-left: auto;
    margin-right: auto;
    width: 50%;
    background-color: rgb(255, 255, 255, 0.8);
  }
`;
const parallax = css `
  background-image: url(./trees.jpeg);
  height: 100%;
  background-attachment: fixed;
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
`;

const caption = css`
  position: absolute;
  left: 0;
  top: 50%;
  width: 100%;
  text-align: center;
  color: #000;
`;

const border = css`
  background-color: #111;
  color: #fff;
  padding: 18px;
  font-size: 25px;
  letter-spacing: 10px;
`;

function Home() {
  return (
    <Layout>
      <div css={parallax}>
        <div css={caption}>
          <span css={border}>SCROLL DOWN</span>
        </div>
      </div>
    </Layout>
  );
}

export default Home;
